import logo from "./logo.svg";
import "./App.css";
import TextField from "@mui/material/TextField";
import { React, useState } from "react";
import { getMoviesList, getMovieID } from "./Controller/MoviesController";
const App = () => {
  const [searchBox, setSearchBox] = useState("");
  const [moviesList, setMoviesList] = useState([]);

  return (
    <div className="App">
      <div className="main">
        <h1></h1>
        <div className="search">
          <TextField
            id="outlined-basic"
            value={searchBox}
            variant="outlined"
            fullWidth
            label="Search"
            onChange={async (word) => {
              setSearchBox(word.target.value);
              await getMoviesList(word.target.value)
                .then((res) => {
                  setMoviesList(res);
                })
                .catch((err) => {
                  console.log("Error: " + err);
                });
            }}
          />
        </div>
      </div>
      {moviesList.map((item) => (
        <li key={item.id}>{item.title}</li>
      ))}
    </div>
  );
};

export default App;
